import React from "react";
import axios from "axios";

export default function Gallery(param) {
  if (param.image !== []) {
    return (
      <div className="Gallery">
        <img
          className="image"
          src={param.image[0].src.small}
          alt={param.image[0].alt}
        />
        <img
          className="image"
          src={param.image[1].src.small}
          alt={param.image[1].alt}
        />
        <img
          className="image"
          src={param.image[2].src.small}
          alt={param.image[2].alt}
        />
      </div>
    );
  }
}
